// Home.js

import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
        <div class="video-background">
            <div class="video-wrap">
                <div id="video">
                    <video id="bgvid" autoplay loop muted playsinline>
                        <source src="stars.mp4" type="video/mp4"></source>
                    </video>
                </div>
            </div>
        </div>
    );
  }
}

export default Home;
